import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Link
} from "react-router-dom";

function Header() {
  return (
    <div className="header">
      <h1>Bank Hero</h1>
      <div className="navigation">
        <ul >
          <li>
            <a href="/home">Home</a>
          </li>
          <li>
            <a href="/profile">Profile</a>
          </li>
        </ul>
      </div>

    </div>
  );
}

export default Header;
